import { Link } from 'react-router-dom';
import '../css/Home.css';
import burakImage from '../assets/burak-profile.jpg';
import Logos from '../logo/Logo';
import backgroundVideo from '../assets/12121108_3840_2160_30fps.mp4';
import register from '../assets/austin-distel-744oGeqpxPQ-unsplash.jpg';
import login from '../assets/desola-lanre-ologun-zYgV-NGZtlA-unsplash.jpg';
import homepage from '../assets/undraw_fingerprint-login_19qv.png';


function Home () {
  return (
    <div className="homeContainer">
      <video autoPlay loop muted className="backgroundVideo">
        <source src={backgroundVideo} type="video/mp4" />
        Tarayıcınız video etiketini desteklemiyor.
      </video>

      <div className='homeMainDiv'>
        <div className='homeFirstDiv'>
          <div className="photograph">
            <img src={burakImage} className="burakImage" alt="Burak Gündoğan" />
          </div>
          <div className="nameSurname">Burak Gündoğan</div>
          <div className="title">Jr.Frontend/Full-Stack/Backend Developer</div>
          <div className="socialMedias">
            Sosyal Medya Hesaplarım ve Github Hesabım
            <p className='Icons'><Logos /></p>
          </div>
          <div className="copyright">Copyright © 2025 - Tüm Hakları Saklıdır.</div>
        </div>

        <div className='homeSecondDiv'>
          <p className="blog">BLOG SAYFAM</p>
          <p className='routerToHomePage' style={{ backgroundImage: `url(${homepage})` }}>Anasayfaya devam etmek için <Link to="/homepage">t ıklayınız !</Link></p>
          <p className='routerToLoginPage' style={{ backgroundImage: `url(${register})` }}>Kayıt olmak için <Link to="/register"> tıklayınız !</Link></p>
          <p className='routerToRegisterPage' style={{ backgroundImage: `url(${login})` }}>Giriş yapmak için <Link to="/login"> tıklayınız !</Link></p>
        </div>
      </div>
    </div>
  );
}

export default Home;
